import './Expenses.css';
import ExpenseItem from './components/ExpenseItem';

function Expenses(data){

    return(
        <div className="expenses">
            <ExpenseItem 
      title={data.title} 
      amount={data.amount} 
      date={data.date}>
      </ExpenseItem>
      <ExpenseItem 
      title={data.title} 
      amount={data.amount} 
      date={data.date}>
      </ExpenseItem>
      <ExpenseItem 
      title={data.title} 
      amount={data.amount} 
      date={data.date}>
      </ExpenseItem>
      <ExpenseItem 
      title={data.title} 
      amount={data.amount} 
      date={data.date}>
      </ExpenseItem>
      


        </div>
    );

}

export default Expenses;
